import React, { useState } from 'react';
// FIX: Removed the following import lines which were causing the resolve error
// import Home from './pages/Home';
// import Login from './pages/Login'; 
// import Signup from './pages/Signup'; 


// Since the 'Home' component is the main app we want to display, 
// we must define it here or assume it's defined elsewhere if we were using a real router.
// For the purpose of running this self-contained App.js file, we will use a minimal mock Home.
// NOTE: In a complete application, you would ensure the actual Home component is available.

const Home = ({ setAuthenticated }) => (
    <div className='flex flex-col min-h-screen bg-gray-50 font-sans'>
        <header className='flex justify-between items-center p-4 bg-white shadow-md'>
            <h1 className='text-3xl font-extrabold text-indigo-700'>
                <span role="img" aria-label="Money bag" className='mr-2'>ðŸ’°</span>
                Finance Tracker
            </h1>
            <button 
                onClick={() => setAuthenticated(false)} 
                className='px-4 py-2 bg-red-600 text-white font-semibold rounded-lg shadow-md hover:bg-red-700 transition duration-200 text-sm'
            >
                Log Out
            </button>
        </header>
        <main className='p-8 text-center'>
            <h2 className='text-2xl text-gray-700'>Home Page Placeholder (Successfully Logged In)</h2>
            <p className='text-gray-500'>The actual complex Home component should be rendered here.</p>
        </main>
    </div>
);


// Mock Components/Setup (since Login/Signup aren't defined here)
const Login = ({ setAuthenticated, switchToSignup }) => (
    <div className="flex justify-center items-center h-screen bg-gray-100">
        <div className="p-8 bg-white shadow-xl rounded-xl">
            <h1 className="text-2xl font-bold mb-4">Login Page</h1>
            <p className="mb-4">Use this mock login to proceed to the app.</p>
            <button 
                onClick={() => setAuthenticated(true)}
                className="w-full py-2 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700 transition"
            >
                Mock Log In
            </button>
            <button 
                onClick={switchToSignup}
                className="w-full py-2 mt-4 text-sm text-indigo-600 hover:text-indigo-800 transition"
            >
                Need an account? Sign Up
            </button>
        </div>
    </div>
);

const Signup = ({ setAuthenticated, switchToLogin }) => (
    <div className="flex justify-center items-center h-screen bg-gray-100">
        <div className="p-8 bg-white shadow-xl rounded-xl">
            <h1 className="text-2xl font-bold mb-4">Signup Page</h1>
            <p className="mb-4">Use this mock signup to proceed to the app.</p>
            <button 
                onClick={() => setAuthenticated(true)}
                className="w-full py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition"
            >
                Mock Sign Up
            </button>
            <button 
                onClick={switchToLogin}
                className="w-full py-2 mt-4 text-sm text-green-600 hover:text-green-800 transition"
            >
                Already have an account? Log In
            </button>
        </div>
    </div>
);


function App() {
    // State to manage current authentication status and displayed page
    const [isAuthenticated, setIsAuthenticated] = useState(false); 
    const [currentPage, setCurrentPage] = useState('LOGIN');

    const setAuthenticated = (status) => {
        setIsAuthenticated(status);
        if (status) {
            setCurrentPage('HOME');
        } else {
            setCurrentPage('LOGIN');
        }
    };

    // Function to handle switching to the signup page from login
    const switchToSignup = () => setCurrentPage('SIGNUP');

    // Function to handle switching to the login page from signup
    const switchToLogin = () => setCurrentPage('LOGIN');


    // Simple routing logic based on state
    let content;

    if (!isAuthenticated) {
        if (currentPage === 'SIGNUP') {
            // Pass the function to switch back to login
            content = <Signup setAuthenticated={setAuthenticated} switchToLogin={switchToLogin} />; 
        } else {
            // Pass the function to switch to signup
            content = <Login setAuthenticated={setAuthenticated} switchToSignup={switchToSignup} />; 
        }
    } else {
        // If authenticated, render the main expense tracker page
        content = <Home setAuthenticated={setAuthenticated} />;
    }

    return (
        <div className="App">
            {content}
        </div>
    );
}

export default App;
